import "./css/style.css";

const flname = "react app";
const currdate = new Date().toLocaleDateString();
const currtime = new Date().toLocaleTimeString();
const heading2 = {
  color: "#b5996c",
  textTransform: "capitalize",
  textAlign: "center",
};
ReactDOM.render(
  <>
    <h1 className="heading"> hello {flname}!!!</h1>
    <h2
      style={{
        color: "#b5996c",
        textTransform: "capitalize",
        textAlign: "center",
      }}
    >{`My first name is ${flname}. Sum of 44 and 55 is ${44 + 55}`}</h2>
    <p>lorem ipsome {5 + 6}</p>
    <h3 style={heading2}>System Date And Time</h3>
    <p>Today's Date is = {currdate}</p>
    <p>Current Time is = {currtime}</p>
